import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => <div>{text}</div>;


class Form extends React.Component {
    constructor() {
        super();
        this.state = {
            nameValue: '',
            ageValue: ''
        }
        this.commonChange = this.commonChange.bind(this);
        this.showValue = this.showValue.bind(this);
    }

    commonChange(event) {
        this.setState({
            [event.target.name]: event.target.value
        });
    }

    showValue(){
        event.preventDefault();
        alert('name '+ this.state.nameValue + ' age: ' + this.state.ageValue)
    }

    render() {
        return (
            <form>
                <label>Name:
                    <input type="text" name="nameValue" onChange={this.commonChange}/>
                </label>
                <label>Age:
                    <input type="text" name="ageValue" onChange={this.commonChange}/>
                </label>
                <input type="submit" value="Submit" onClick={this.showValue}/>
            </form>

        );
    }
}

ReactDOM.render(<Form/>, document.getElementById('app'))

class SimpleMap extends Component {
  static defaultProps = {
    center: {
      lat: -30.0277,
      lng: -51.2287
    },
    zoom: 11
  };

  render() {
    return (
      // Important! Always set the container height explicitly
      <div style={{ height: '100vh', width: '100%' }}>
        <GoogleMapReact
          bootstrapURLKeys={{ key: 'AIzaSyCw1Cu5QmZqsFLWq-D7m12E3Qqjjj13xWY' }}
          defaultCenter={this.props.center}
          defaultZoom={this.props.zoom}
        >
          <AnyReactComponent
            lat={-30.0277}
            lng={-51.2287}
            text="sim"
          />
        </GoogleMapReact>
      </div>
    );
  }
}

export default SimpleMap;
